class WebSocketCustom {
  _url;
  _ws;
  /** @type {MessagePortCustom} */
  _messagePortCustom;

  _keepAliveTimer = -1;
  _onceOpened = false;

  _pingTimer = -1;
  _messageTimeoutTimer = -1;
  _backgroundRetryTimer = -1;
  _waitBlurTimer = -1;
  _backgroundRetryCount = 0;
  _isStartBackgroundRetrying = false;
  _isWaitReconnection = false;

  constructor(url, messagePortCustom) {
    this._url = url;
    this._messagePortCustom = messagePortCustom;

    this._createWebSocket();
  }

  _createWebSocket = () => {
    const ws = new WebSocket(this._url);
    ws.onopen = (...args) => this._onopen(...args);
    ws.onmessage = (...args) => this._onmessage(...args);
    ws.onerror = (...args) => this._onerror(...args);
    ws.onclose = (...args) => this._onclose(...args);

    this._ws = ws;
  };

  _onopen = (e) => {
    logs('\u{fe0f} ws onopen');
    this._messagePortCustom.postMessage({
      id: this._url,
      type: '_onopen',
    });

    this._stopPing();
    this._stopMessageTimeout();
    this._stopBackgroundRetry();
    this._stopWaitBlurTimeout();
    this._backgroundRetryCount = 0;
    this._isStartBackgroundRetrying = false;
    this._isWaitReconnection = true;
    this._onceOpened = true;

    this._startPing();
  };
  _onmessage = (e) => {
    this._stopMessageTimeout();

    try {
      const data = JSON.parse(e.data);
      logs('\u{fe0f} ws onmessage', data);

      this._messagePortCustom.postMessage({
        id: this._url,
        type: '_onmessage',
        data,
      });
    } catch (error) {
      console.log('JSON parse', error);
    }
  };
  _onerror = (e) => {
    logs('\u{fe0f} ws onerror', e);

    console.error('onerror', e);
  };
  _onclose = (e) => {
    logs('\u{fe0f} ws onclose', e);
    this._ws = undefined;
    this._messagePortCustom.postMessage({
      id: this._url,
      type: '_onclose',
      data: {
        code: e.code,
        reason: e.reason,
        wasClean: e.wasClean,
      },
    });

    this._stopWsKeepAlive();

    this._stopPing();
    this._stopMessageTimeout();

    if (e.code >= 4001) {
      return;
    }

    if (this._onceOpened && this._isWaitReconnection) {
      this._isWaitReconnection = false;
      this._startWaitBlurTimeout(() => {
        this._messagePortCustom.collectFocusStatus((hasFocus) => {
          this._messagePortCustom.postMessage({
            type: '_setWsAutoReConnection',
            data: {
              value: hasFocus ? 'waitClick' : 'auto',
            },
          });
        });
      });
    } else {
      this._isStartBackgroundRetrying = false;
      this.startBackgroundRetry();
    }
  };

  wsSend = (data) => {
    logs('\u{fe0f} ws send', data);

    this._ws.send(JSON.stringify(data));
  };

  wsClose = (data) => {
    const { code = 4001 } = data ? data : {};

    try {
      if (this._ws) {
        this._ws.onopen = null;
        this._ws.onmessage = null;
        this._ws.onerror = null;
        const onclose = this._ws.onclose;
        if (onclose) {
          this._ws.onclose = null;
          onclose({ code });
        }
      }
    } catch (error) {
      console.log('close error', error);
    }
    this._ws = undefined;
  };

  wsReadyState = () => {
    if (!this._ws) {
      return undefined;
    }

    return this._ws.readyState;
  };

  wsKeepAlive = (data) => {
    this._startWsKeepAlive(data);
  };

  _startWsKeepAlive = (data) => {
    this._stopWsKeepAlive();

    const { timeout = -1 } = data ? data : {};
    if (timeout >= 0) {
      this._keepAliveTimer = setTimeout(() => {
        if (this._ws && this._ws.readyState === WebSocket.OPEN) {
          this.wsClose();
          this._messagePortCustom.postMessage({
            type: '_setWsAutoReConnection',
            data: {
              value: 'auto',
            },
          });
        }
      }, timeout);
    }
  };
  _stopWsKeepAlive = () => {
    clearTimeout(this._keepAliveTimer);
  };

  _startSetMessageTimeout = () => {
    this._messageTimeoutTimer = setTimeout(() => {
      this.wsClose({ code: 4000 });
    }, 5000);
  };
  _stopMessageTimeout = () => {
    clearTimeout(this._messageTimeoutTimer);
  };

  _startPing = () => {
    this._stopPing();
    this._stopMessageTimeout();

    this.wsSend({ type: 'ping' });
    this._startSetMessageTimeout();
    this._pingTimer = setTimeout(this._startPing, 60000);
  };
  _stopPing = () => {
    clearTimeout(this._pingTimer);
    this._stopMessageTimeout();
  };

  startBackgroundRetry = () => {
    if (this._isStartBackgroundRetrying) {
      return;
    }

    this._isStartBackgroundRetrying = true;
    const maxRetryCount = 4;

    if (this._backgroundRetryCount > maxRetryCount) {
      this._messagePortCustom.postMessage({
        type: '_setWsAutoReConnection',
        data: {
          value: 'pause',
        },
      });
      return;
    }
    let multiple = Number(globalScope.__multiple);
    if (Number.isNaN(multiple) || multiple <= 0) {
      multiple = 10;
    }

    let firstAutoReconnectionBeginTime = Number(globalScope.__firstAutoReconnectionBeginTime);
    if (Number.isNaN(firstAutoReconnectionBeginTime) || firstAutoReconnectionBeginTime <= 0) {
      firstAutoReconnectionBeginTime = 10000;
    }
    let firstAutoReconnectionRandomDuration = Number(
      globalScope.__firstAutoReconnectionRandomDuration,
    );
    if (
      Number.isNaN(firstAutoReconnectionRandomDuration) ||
      firstAutoReconnectionRandomDuration <= 0
    ) {
      firstAutoReconnectionRandomDuration = 60000;
    }

    let remainingDuration = Math.pow(2, this._backgroundRetryCount) * multiple * 1000;
    if (this._backgroundRetryCount === 0) {
      remainingDuration =
        firstAutoReconnectionBeginTime +
        Math.floor(Math.random() * firstAutoReconnectionRandomDuration);
    }

    const loop = () => {
      this._messagePortCustom.postMessage({
        type: '_setWsAutoReConnection',
        data: {
          value: 'backgroundRetry',
          remainingDuration: Math.ceil(remainingDuration / 1000),
        },
      });

      if (remainingDuration > 0) {
        let timeout = 1000;
        if (remainingDuration < timeout) {
          timeout = remainingDuration;
          remainingDuration = 0;
        } else {
          remainingDuration -= timeout;
        }
        this._stopBackgroundRetry();
        this._backgroundRetryTimer = setTimeout(loop, timeout);
      } else {
        this._backgroundRetryCount++;

        this._createWebSocket();
      }
    };

    loop();
  };

  _stopBackgroundRetry = () => {
    clearTimeout(this._backgroundRetryTimer);
  };

  _startWaitBlurTimeout = (callback) => {
    this._stopWaitBlurTimeout();
    this._waitBlurTimer = setTimeout(() => {
      if (typeof callback === 'function') {
        callback();
      }
    }, 500);
  };

  _stopWaitBlurTimeout = () => {
    clearTimeout(this._waitBlurTimer);
  };

  destroy = () => {
    this.wsClose();

    this._stopWaitBlurTimeout();
    this._stopBackgroundRetry();
    this._stopMessageTimeout();
    this._stopPing();
    this._stopWsKeepAlive();
  };
}

class MessagePortCustom {
  static _focusStatus = [];
  static _focusTimer = -1;

  _ports = [];
  /**
   * @type {WebSocketCustom}
   */
  _webSocketCustom;
  _messageKeyMap = {};

  addMessagePort = (port) => {
    port.onmessage = (e) => {
      return this._onMessage(e, port);
    };
    if (typeof port.start === 'function') {
      port.start();
    }

    this._ports.push(port);
  };

  postMessage = (data) => {
    this._ports.forEach((x) => {
      x.postMessage(data);
    });
  };

  _onMessage = (e, port) => {
    const eventData = e.data ? e.data : {};
    const { type = '', data = {}, id } = eventData;
    if (type !== 'wsSend') {
      logs('->', eventData);
    }

    let result = undefined;
    let errorMessage = undefined;

    try {
      const fn = this['__' + type];
      if (typeof fn !== 'function') {
        throw new Error('no type support');
      }

      result = fn(data, port);
    } catch (error) {
      errorMessage = error.message;
    }

    const message = {
      id,
      type: '_' + type,
      errorMessage,
      data: result,
    };
    this.postMessage(message);
    logs('<-', message);
  };

  __wsConnection = (wsOpenData = {}) => {
    const readyState = this._webSocketCustom ? this._webSocketCustom.wsReadyState() : undefined;
    if (readyState !== undefined) {
      return readyState;
    }

    if (this._webSocketCustom) {
      this._webSocketCustom.destroy();
    }

    let url = globalScope.__url;
    if (!url) {
      url = wsOpenData.url;
    }

    this._webSocketCustom = new WebSocketCustom(url, this);

    return this._webSocketCustom.wsReadyState();
  };

  __wsSend = (data) => {
    if (this._webSocketCustom) {
      this._webSocketCustom.wsSend(data);
    }
  };

  __wsClose = (data) => {
    if (this._webSocketCustom) {
      this._webSocketCustom.wsClose(data);
    }
  };

  __sendMessageThrottle = (data) => {
    const { key, operatorId, type = 'add', messageData, alwaysSend = false } = data;

    if (!this._messageKeyMap[key]) {
      this._messageKeyMap[key] = new Set();
    }
    const set = this._messageKeyMap[key];
    if (type === 'delete') {
      set.delete(operatorId);
    } else {
      set.add(operatorId);
    }

    if (this._webSocketCustom) {
      if (
        this._webSocketCustom.wsReadyState() === WebSocket.OPEN &&
        (set.size === 0 || alwaysSend)
      ) {
        if (messageData) {
          this._webSocketCustom.wsSend(messageData);
        }
      }
    }

    return [...set];
  };

  __closeTab = (data, port) => {
    if (isWeb) {
      const index = this._ports.findIndex((x) => x === port);
      if (index > -1) {
        this._ports.splice(index, 1);
      }

      port.onmessage = null;
      if (port && typeof port.close === 'function') {
        port.close();
      }
    }
  };

  __wsKeepAlive = (data) => {
    if (this._webSocketCustom) {
      this._webSocketCustom.wsKeepAlive(data);
    }
  };

  __tabFocusStatus = (data) => {
    const { isFocus = false } = data;

    MessagePortCustom._focusStatus.push(isFocus);
  };

  __startBackgroundRetry = () => {
    if (this._webSocketCustom) {
      const readyState = this._webSocketCustom.wsReadyState();
      if (readyState === WebSocket.CLOSED || readyState === undefined) {
        this._webSocketCustom.startBackgroundRetry();
      }
    }
  };

  collectFocusStatus = (callback) => {
    MessagePortCustom._focusStatus = [];
    this.postMessage({
      type: '_collectFocusStatus',
    });

    clearTimeout(MessagePortCustom._focusTimer);
    MessagePortCustom._focusTimer = setTimeout(() => {
      if (typeof callback === 'function') {
        callback(MessagePortCustom._focusStatus.some((x) => x === true));
      }
    }, 100);
  };
}

